import { Link } from "react-router-dom";
import "./Navbar.css";

class AddContact extends Component {
  render() {
    return (
      <div className="main">
        <h1 style={{ color: "grey" }}>Add New Contact</h1>
        <div className="row>">
          <form>
            <div className="form-group">
              <label for="fullname">Fullname:</label>
              <input
                class="form-control"
                type="text"
                id="fullname"
                name="fullname"
                value=""
              />
            </div>
          </form>
        </div>
      </div>
    );
  }
}

export default AddContact;
